import LoginIcon from '@mui/icons-material/LoginOutlined';
import SearchIcon from '@mui/icons-material/SearchOutlined';
import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  position: sticky; 
  top: 0;
  background-color: ${({theme}) => theme.bg};
  height: 56px;
`;

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  height: 100%;
  padding 10px 0px;
`;

const Search = styled.div`

`;

const Input = styled.input`

`;

const Button = styled.button`
  padding: 3px 15px;
  background-color: transparent;
  border: 1px solid #3ea6ff;
  color: #3ea6ff;
  border-radius: 5px;
  font-weight: bold;
  margin: 15px;
  margin-top: 7px;
  margin-bottom: 10px;
  cursor: pointer;
  display: flex;
  align-items: center;
  gap: 5px;
  padding-left: 5px;
  padding-right: 12px;
`;

const Navbar = () => {
  return (
    <Container>
      <Wrapper><Search><Input placeholder="Search"/><SearchIcon/></Search>
      <Button><LoginIcon></LoginIcon>SIGN IN</Button>
      </Wrapper>
    </Container>
  )
}

export default Navbar
